import React, { Component } from "react";
import SingleCard from "./SingleCard";
var bg = {
  background: "white",
  color: "white"
};
export class Card extends Component {
  render() {
    return <div className="container text-primary text-center" style={bg}>
        <br />
        <h1>Rokkhi for Everyone</h1>
        <br />
        <div class="card-deck">
          <SingleCard />
          <SingleCard />
          <SingleCard />
        </div>
      </div>;
  }
}

export default Card;
